import React from 'react';
import '../style/LoadingLogin.css'

class LoadingLogin extends React.Component {
  render() {
    return (
    <section className='LoadingContent'>
      <section className='c-loader'>
      <p></p>
      </section>
      </section>  
    );
  }
}

export default LoadingLogin;
